import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

const Streak = ({ streakName }) => {
    return (
        <View style={styles.streakContainer}>
            <Text>{ streakName }</Text>
        </View>
    )
}

export default Streak;

const styles = StyleSheet.create({
    streakContainer: {
        width: 150,
        height: 150,
        backgroundColor: 'red',
        borderRadius: 5,

    }
})
